export const CharacterImage = ({ name, url }) => {
    if(url) return <img src={url} />
    switch (name) {
        case "banky":
            return (
                <img
                    src={
                        require(`../assets/images/character/big/banky.png`)
                            .default
                    }
                />
            );
        case "brainy":
            return (
                <img
                    src={
                        require(`../assets/images/character/big/brainy.png`)
                            .default
                    }
                />
            );
        case "jack":
            return (
                <img
                    src={
                        require(`../assets/images/character/big/jack.png`)
                            .default
                    }
                />
            );
        case "puter":
            return (
                <img
                    src={
                        require(`../assets/images/character/big/puter.png`)
                            .default
                    }
                />
            );
        case "level of readiness":
            return (
                <img
                    src={
                        require(`../assets/images/character/big/level-of-readiness.png`)
                            .default
                    }
                />
            );
        case "temperate":
            return (
                <img
                    src={
                        require(`../assets/images/character/big/temperate.png`)
                            .default
                    }
                />
            );
     
        case "banky-o":
            return (
                <img
                    src={
                        require(`../assets/images/character/outline/banky-o.png`)
                            .default
                    }
                />
            );
        case "brainy-o":
            return (
                <img
                    src={
                        require(`../assets/images/character/outline/brainy-o.png`)
                            .default
                    }
                />
            );
        case "jack-o":
            return (
                <img
                    src={
                        require(`../assets/images/character/outline/jack-o.png`)
                            .default
                    }
                />
            );
        case "puter-o":
            return (
                <img
                    src={
                        require(`../assets/images/character/outline/puter-o.png`)
                            .default
                    }
                />
            );
        case "level of readiness-o":
            return (
                <img
                    src={
                        require(`../assets/images/character/outline/level-of-readiness-o.png`)
                            .default
                    }
                />
            );
        case "temperate-o":
            return (
                <img
                    src={
                        require(`../assets/images/character/outline/temperate-o.png`)
                            .default
                    }
                />
            );

        default:
            return <div/>
            break;
    }
};


